import React, { useState , useRef } from 'react';

const Uploadcon = () => {
    const [trainingDataset, setTrainingDataset] = useState(null);
    const [validationDataset, setValidationDataset] = useState(null);
    const [message, setMessage] = useState('');

    const trainingFileRef = useRef();    
    const validationFileRef = useRef();
    const [dataset, setDataset] = useState(null);
    const [validation, setValidation] = useState(null);
    const [datasetInfo, setDatasetInfo] = useState(null);

    const handleDatasetUpload = (event, datasetType) => {
        const file = event.target.files[0];
        if (file.type !== 'application/zip' && file.type !== 'application/x-zip-compressed') {
            setMessage('Invalid File Type! Please upload a zip file.');
            return;
        }

        if (datasetType === 'training') {
            setTrainingDataset(file);
        } else if (datasetType === 'validation') {
            setValidationDataset(file);
        }
    };

    // const handleTrainingDatasetUpload = (event) => {
    //     const file = event.target.files[0];
    //     if (file.type !== 'application/zip' && file.type !== 'application/x-zip-compressed') {
    //         setMessage('Invalid File Type! Please upload a zip file.');
    //         return;
    //     }
    //     setTrainingDataset(file);
    // };

    // const handleValidationDatasetUpload = (event) => {
    //     const file = event.target.files[0];
    //     setValidationDataset(file);
    // };

    const handleSubmit = async () => {
        if (!trainingDataset || !validationDataset) {
            setMessage('Please upload both training and validation datasets!');
            return;
        }

        let formData = new FormData();
        formData.append('dataset', trainingDataset); // Changed key to 'dataset'
        formData.append('validation', validationDataset); // Changed key to 'validation'

        try {
            const response = await fetch('http://localhost:8000/upload', {
                method: 'POST',
                body: formData,
            });

            if (response.ok) {
                const data = await response.json();
                console.log('Response:', data);
                setMessage('Datasets Upload successful!');

                const { dataset, validation, dataset_info } = data;

                setDataset(dataset);
                setValidation(validation); // Corrected state setter function
                setDatasetInfo(dataset_info);   

            } else {
                console.log('Error', response.statusText);
                setMessage('Error uploading datasets!');
            }
        } catch (error) {
            console.error('Error:', error);
            setMessage('Error uploading datasets!');
        }
    };

    const handleReset = () => {
        setTrainingDataset(null);
        setValidationDataset(null);
        setMessage('Clearing datasets...');
        if (trainingFileRef.current) {
            trainingFileRef.current.value = '';
        }
        if (validationFileRef.current) {
            validationFileRef.current.value = '';
        }
    }

    return (
        <div>
        <h1 className='text-xl font-bold mb-4'>Upload Training and Validation Datasets</h1>
        <div className='flex justify-between'>
            <div style={{width: '45%'}}>
                <h2 className ="text-xl font-semibold mb-2">Training Dataset</h2>
                <input type="file" accept=".zip" onChange={(event) => handleDatasetUpload(event, 'training')} />
            </div>
            <div style={{width: '45%'}}>
                <h2 className ="text-xl font-semibold mb-2">Validation Dataset</h2>
                <input type="file" accept=".zip" onChange={(event) => handleDatasetUpload(event, 'validation')} />
            </div>
        </div>
        <button onClick={handleSubmit} className="bg-blue-500 text-white p-2 rounded mt-4">Upload</button>
        <button onClick={handleReset} className="bg-red-500 text-white p-2 rounded mt-4 ml-2">Reset</button>
        {message && <p>{message}</p>}
        {dataset && <p>Dataset: {JSON.stringify(dataset)}</p>}
        {validation && <p>Validation: {JSON.stringify(validation)}</p>}
        {datasetInfo && (
            <div>
                <h2>Dataset Info:</h2>
                <table>
                    <thead>
                        <tr>
                            <th></th>
                            <th>G Count</th>
                            <th>NG Count</th>
                            <th>Slide Count</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Training Dataset</td>
                            <td>{datasetInfo.train_dataset.g_count}</td>
                            <td>{datasetInfo.train_dataset.ng_count}</td>
                            <td>{datasetInfo.train_dataset.slide_count}</td>
                        </tr>
                        <tr>
                            <td>Validation Dataset</td>
                            <td>{datasetInfo.validation_dataset.val_g_count}</td>
                            <td>{datasetInfo.validation_dataset.val_ng_count}</td>
                            <td>{datasetInfo.validation_dataset.val_slide_count}</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )}
    </div>
    );
};

export default Uploadcon;
